import Brands from "./Brands";
import Capitals from "./Capitals";
import Countries from "./Countries";
import Movies from "./Movies";
import Occupation from "./Occupation";

export const wordCollection = {
    'Brands': Brands,
    'Capitals': Capitals,
    'Countries': Countries,
    'Movies': Movies,
    'Occupation': Occupation
}
